import React from "react";
import "react-toastify/dist/ReactToastify.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./screens/Login";
import Register from "./screens/Register";
import ProfileScreen from "./screens/ProfileScreen";
import NotFound from "./screens/NotFound";
import "./Styles/style.scss";
//import ProfileTabs from "./components/profileComponents/ProfileTabs";
//import HomeTabs from "./components/profileComponents/HomeTabs";
//import Transactions from "./components/profileComponents/Transactions";
//import TransactionList from "./components/profileComponents/TransactionList";
//import PrivateRouter from "./PrivateRouter";

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} exact />
        <Route path="/register" element={<Register />} />
        <Route path="/profile" element={<ProfileScreen />} />
        {/*<Route path="/profile/profileTabs" element={<ProfileTabs />} />
        <Route path="/profile/homeTabs" element={<HomeTabs />} />
        <Route path="/profile/paying" element={<Transactions />} />
  <Route path="/profile/transactionList" element={<TransactionList />} />*/}
        <Route path="*" element={<NotFound />} />
      </Routes>
    </Router>
  );
};

export default App;
